met Shea Whigham, Paulo Costanzo en Jill Wagner

Een jong stel gaat een weekendje romantisch kamperen in de wildernis. Al snel loopt de trip uit op een regelrechte nachtmerrie, 
wanneer een ander stel, bestaande uit een crimineel en zijn vriendin, roet in het eten gooit. De twee koppels komen aan bij een 
verlaten pompstation, hier breekt de hel echter pas echt los...
